import React, {Component} from 'react';
import $ from 'jquery';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';
import Select from 'react-select'

class SearchTrainings extends Component {
  constructor(props) {
    super(props);

    this.onSelect = this.onSelect.bind(this);

    this.state = {
      options: [
          'one', 'two', 'three'
      ]
    };

  }

  onSelect() {

  }

  componentDidMount() {
  }

  componentDidUpdate() {
  }


  render() {
    const {options} = this.state;

    return (
      <div class="search-trainings-container">
        <h5>Search Trainings</h5>
        <Select
							placeholder={IaaSFunctions.IAAS_ENVIRONMENTS.title}
							isSearchable={true}
							isMulti={false}
							autoFocus={false}
							onChange={this.handleSelect('env')}
							options={IaaSFunctions.IAAS_ENVIRONMENTS.value}
							value={env}
							name="env"
							maxMenuHeight={200}
						/>


      </div>
    );
  }
}
export default SearchTrainings;
